# load db_mr
file_mrdb = 'data/collect/mr_collect.csv'

tryCatch({
  db_mr = fread(file_mrdb)
  # Replace COVID19 with COVID-19 in exposure_name and outcome_name
  db_mr$exposure_name = gsub("COVID19", "COVID-19", db_mr$exposure_name)
  db_mr$outcome_name = gsub("COVID19", "COVID-19", db_mr$outcome_name)
  db_mr$exposure_db = toupper(str_split_fixed(db_mr$exposure, '_', 2)[,1])
  db_mr$outcome_db = toupper(str_split_fixed(db_mr$outcome, '_', 2)[,1])
  db_mr$exposure_name = paste0(db_mr$exposure_db, ': ', db_mr$exposure_name)
  db_mr$outcome_name = paste0(db_mr$outcome_db, ': ', db_mr$outcome_name)
  db_mr = db_mr%>%relocate(exposure_name, outcome_name, exposure_umls, outcome_umls, exposure, outcome)
}, error = function(e) {
  print(paste("Error loading MR data:", e$message))
  # Create empty data frame with required columns
  db_mr <<- data.frame(
    exposure = character(),
    outcome = character(),
    exposure_name = character(),
    outcome_name = character(),
    exposure_db = character(),
    outcome_db = character(),
    exposure_umls = character(),
    outcome_umls = character(),
    stringsAsFactors = FALSE
  )
})

## default value
print('making default values ...')
input_default = list()
input_default$pthres_ivw = 0.05; input_default$pthres_egger = 1; input_default$pthres_wmedian = 1; input_default$pthres_wmode = 1
input_default$thres_nsnp = 10; input_default$net_depth = 1
input_default$db = dbs

tryCatch({
  # get links
  input_default$links = select_links(input_default, db_mr) # use db, nsnp, and pthres of 4 methods
  
  # get traits
  input_default$traits = extract_traits(input_default$links)
  
  # select a trait
  input_default$trait = 'FIN: Actinic keratosis'
  
  # make graph based on the trait
  input_default$graph = select_graph(input_default$links, trait = input_default$trait, depth = input_default$net_depth)
  
  # select exposure and outcome
  input_default$exposures = unique(input_default$graph$exposure_name)
  input_default$exposure = 'FIN: Actinic keratosis'
  input_default$outcomes = unlist(input_default$graph%>%filter(exposure_name==input_default$exposure)%>%pull(outcome_name), use.names=F)
  input_default$outcome = input_default$outcomes[1] 
}, error = function(e) {
  print(paste("Error initializing default values:", e$message))
  # Set safe defaults
  input_default$links <<- data.frame()
  input_default$traits <<- character(0)
  input_default$trait <<- "No data"
  input_default$graph <<- data.frame()
  input_default$exposures <<- character(0)
  input_default$exposure <<- "No data"
  input_default$outcomes <<- character(0)
  input_default$outcome <<- "No data"
})
print('done!')

