file_ldscdb <- 'data/ldsc_collect.csv'

tryCatch({
  db_ldsc = fread(file_ldscdb)
  # Replace COVID19 with COVID-19 in trait names
  db_ldsc$trait1_name = gsub("COVID19", "COVID-19", db_ldsc$trait1_name)
  db_ldsc$trait2_name = gsub("COVID19", "COVID-19", db_ldsc$trait2_name)
  db_ldsc_sym <- rbind(
    db_ldsc,
    db_ldsc %>%
      dplyr::rename(
        trait1_name = trait2_name,
        trait2_name = trait1_name,
        h2_1 = h2_2, h2_1_se = h2_2_se, h2_1_p = h2_2_p,
        h2_2 = h2_1, h2_2_se = h2_1_se, h2_2_p = h2_1_p
      )
  )
  
  all_traits <- sort(unique(c(db_ldsc_sym$trait1_name, db_ldsc_sym$trait2_name)))
  
  input_default_ldsc <- list(
    trait1 = ifelse("UKB:Diabetes diagnosed by doctor" %in% all_traits,
                    "UKB:Diabetes diagnosed by doctor", all_traits[1]),
    trait1s = all_traits
  )
}, error = function(e) {
  print(paste("Error loading LDSC data:", e$message))
  # Create empty data structures
  db_ldsc <<- data.frame()
  db_ldsc_sym <<- data.frame()
  input_default_ldsc <<- list(trait1 = "No data", trait1s = character(0))
})



