#================================================================
# server
#================================================================
server = function(input, output, session) {
  # Simple error observer
  # observe({
  #   if (is.null(input$db) || length(input$db) == 0) {
  #     showNotification("Please select at least one database", type = "warning")
  #   }
  # })
  
  # Validate database selection
  # observeEvent(input$db, {
  #   if (is.null(input$db) || length(input$db) == 0) {
  #     showNotification("Please select at least one database", type = "warning")
  #   }
  # })
  # update traits and links by setting
  updateTraits <- reactive({
    withProgress(message="Extracting traits ...", value=0, {
      print('extracting traits ...')
      
      tryCatch({
        links = select_links(input, db_mr)
        if (is.null(links) || nrow(links) == 0) {
          return(list(links=data.frame(), traits=character(0)))
        }
        
        traits = extract_traits(links)
        if (is.null(traits) || length(traits) == 0) {
          return(list(links=links, traits=character(0)))
        }
        
        print('done!')
        list(links=links, traits=traits)
      }, error = function(e) {
        print(paste("Error in updateTraits:", e$message))
        return(list(links=data.frame(), traits=character(0)))
      })
    })
  })
  
  # update network by selected trait, net_depth, and links
  updateNetwork <- reactive({
    withProgress(message="Updating network ...", value=0, {
      print('updating network ...')
      
      tryCatch({
        if (is.null(input$trait) || input$trait == "") {
          return(list(graph=data.frame(), igraph=NULL, d3graph=list(nodes=data.frame(), links=data.frame()), exposures=character(0)))
        }
        if (is.null(input$net_depth) || input$net_depth < 1) {
          return(list(graph=data.frame(), igraph=NULL, d3graph=list(nodes=data.frame(), links=data.frame()), exposures=character(0)))
        }
        
        links = updateTraits()$links
        if (is.null(links) || nrow(links) == 0) {
          return(list(graph=data.frame(), igraph=NULL, d3graph=list(nodes=data.frame(), links=data.frame()), exposures=character(0)))
        }
        
        graph = select_graph(links, trait = input$trait, depth = input$net_depth)
        if (is.null(graph) || nrow(graph) == 0) {
          return(list(graph=data.frame(), igraph=NULL, d3graph=list(nodes=data.frame(), links=data.frame()), exposures=character(0)))
        }
        
        exposures = unique(graph$exposure_name)
        if (length(exposures) == 0) {
          return(list(graph=data.frame(), igraph=NULL, d3graph=list(nodes=data.frame(), links=data.frame()), exposures=character(0)))
        }
        
        igraph = make_igraph(graph)
        d3graph = make_d3graph(igraph, links = graph, trait = input$trait)
        
        print('done!')
        list(graph=graph, igraph=igraph, d3graph=d3graph, exposures=exposures)
      }, error = function(e) {
        print(paste("Error in updateNetwork:", e$message))
        return(list(graph=data.frame(), igraph=NULL, d3graph=list(nodes=data.frame(), links=data.frame()), exposures=character(0)))
      })
    })
  })

  # update mr statistics 
  updateMRres <- reactive({
    withProgress(message="Extract MR statistics ...", value=0, {
      print('extract statistics ...')
      
      tryCatch({
        if (is.null(input$exposure) || input$exposure == "") {
          return(list(mr_res=list(coef=data.frame(), dat=data.frame(), supp=list())))
        }
        if (is.null(input$outcome) || input$outcome == "") {
          return(list(mr_res=list(coef=data.frame(), dat=data.frame(), supp=list())))
        }
        
        graph = updateNetwork()$graph
        if (is.null(graph) || nrow(graph) == 0) {
          return(list(mr_res=list(coef=data.frame(), dat=data.frame(), supp=list())))
        }
        
        mr_res = get_mr_res(graph, input$exposure, input$outcome)
        if (is.null(mr_res)) {
          return(list(mr_res=list(coef=data.frame(), dat=data.frame(), supp=list())))
        }
        
        print('extract statistics finish')
        list(mr_res=mr_res)
      }, error = function(e) {
        print(paste("Error in updateMRres:", e$message))
        return(list(mr_res=list(coef=data.frame(), dat=data.frame(), supp=list())))
      })
    })
  })

  
  observeEvent(c(input$thres_nsnp, input$pthres_ivw, input$pthres_egger, input$pthres_wmedian, input$pthres_wmode), { #, input$db
    print('observe 1 ...')
    # print(input$db)
    traits_result = updateTraits()
    if (!is.null(traits_result) && length(traits_result$traits) > 0) {
      updateSelectInput(session, "trait", choices=traits_result$traits)
    } else {
      updateSelectInput(session, "trait", choices=character(0))
    }
    print('observe 1 finish')
  })

  observeEvent(c(input$trait, input$net_depth), {
    print('observe 2 ...')
    network_result = updateNetwork()
    if (!is.null(network_result) && length(network_result$exposures) > 0) {
      updateSelectInput(session, "exposure", choices=network_result$exposures)
    } else {
      updateSelectInput(session, "exposure", choices=character(0))
    }
    print('observe 2 finish')
  })
    
  observeEvent(c(input$exposure), {
    print('observe 3 ...')
    if (!is.null(input$exposure) && input$exposure != "") {
      network_result = updateNetwork()
      if (!is.null(network_result) && nrow(network_result$graph) > 0) {
        outcomes = unlist(network_result$graph%>%dplyr::filter(exposure_name==input$exposure)%>%pull(outcome_name), use.names=F)
        if (length(outcomes) > 0) {
          updateSelectInput(session, "outcome", choices=outcomes)
        } else {
          updateSelectInput(session, "outcome", choices=character(0))
        }
      } else {
        updateSelectInput(session, "outcome", choices=character(0))
      }
    } else {
      updateSelectInput(session, "outcome", choices=character(0))
    }
    print('observe 3 finish')
  })


  # plot 
  output$mrnet <- renderForceNetwork({
    network_result = updateNetwork()
    if (!is.null(network_result) && !is.null(network_result$d3graph) && 
        nrow(network_result$d3graph[['links']]) > 0 && nrow(network_result$d3graph[['nodes']]) > 0) {
      forceNetwork(Links = network_result$d3graph[['links']], 
                  Nodes = network_result$d3graph[['nodes']], 
                  opacity = 1, fontSize = 20,
                  Group = 'group', Source = "source", Target = "target", 
                  NodeID = "name", Value = 'value', arrows = T, legend = T)
    } else {
      # Return empty network
      forceNetwork(Links = data.frame(source=integer(), target=integer(), value=integer()),
                  Nodes = data.frame(name=character(), group=character(), id=integer()),
                  opacity = 1, fontSize = 20,
                  Group = 'group', Source = "source", Target = "target", 
                  NodeID = "name", Value = 'value', arrows = T, legend = T)
    }
  })

  output$mrheatmap = renderPlotly({
    tryCatch({
      network_result = updateNetwork()
      if (!is.null(network_result) && nrow(network_result$graph) > 0) {
        p <- mr_heatmap(network_result$graph)
        ggplotly(p)
      } else {
        # Return empty plot
        plot_ly() %>% layout(title = "No data available")
      }
    }, error = function(e) {
      print(paste("Error in mrheatmap:", e$message))
      plot_ly() %>% layout(title = "Error loading heatmap")
    })
  })

  output$mrscatter = renderPlotly({
    mr_result = updateMRres()
    if (!is.null(mr_result) && !is.null(mr_result$mr_res) && 
        nrow(mr_result$mr_res[['coef']]) > 0 && nrow(mr_result$mr_res[['dat']]) > 0) {
