  # LDSC Server Logic
  select_graph_ldsc <- function(center_trait, depth = 2, topN = 5, rg_cutoff = 0.3, h2_cutoff = 0.005) {
    all_nodes <- list()
    all_edges <- list()
    layer_map <- list()
    all_nodes[[1]] <- center_trait
    layer_map[[center_trait]] <- 0
    
    for (i in 1:depth) {
      prev_layer_nodes <- all_nodes[[i]]
      next_layer_nodes <- c()
      layer_edges <- data.frame()
      
      for (node in prev_layer_nodes) {
        neighbors <- db_ldsc_sym %>%
          dplyr::filter(
            trait1_name == node, 
            abs(rg) > rg_cutoff,
            h2_1 > h2_cutoff,
            h2_2 > h2_cutoff
          ) %>%
          arrange(desc(abs(rg))) %>%
          head(topN)
        
        if (nrow(neighbors) > 0) {
          new_nodes <- setdiff(neighbors$trait2_name, unlist(all_nodes))
          next_layer_nodes <- c(next_layer_nodes, new_nodes)
          layer_edges <- rbind(layer_edges, neighbors %>% dplyr::filter(trait2_name %in% new_nodes))
          for (n in new_nodes) layer_map[[n]] <- i
        }
      }
      
      if (length(next_layer_nodes) == 0) break
      all_nodes[[i + 1]] <- unique(next_layer_nodes)
      all_edges[[i]] <- layer_edges
    }
    
    if (length(all_edges) == 0 || all(sapply(all_edges, nrow) == 0)) return(NULL)
    
    final_edges <- do.call(rbind, all_edges)
    final_nodes <- unique(c(final_edges$trait1_name, final_edges$trait2_name))
    
    node_df <- data.frame(
      name = final_nodes,
      group = sapply(final_nodes, function(x) {
        if (x == center_trait) {
          return("Focus")
        } else if (startsWith(x, "UKB:")) {
          return("UKB")
        } else if (startsWith(x, "FIN:")) {
          return("FIN")
        } else {
          return("Other")
        }
      }),
      stringsAsFactors = FALSE
    )
    node_df$id <- 0:(nrow(node_df) - 1)
    
    links <- final_edges %>%
      left_join(node_df, by = c("trait1_name" = "name")) %>% dplyr::rename(source = id) %>%
      left_join(node_df, by = c("trait2_name" = "name")) %>% dplyr::rename(target = id) %>%
      mutate(value = 1) %>%
      dplyr::select(source, target, value)
    
    list(nodes = node_df, links = links)
  }
  
  output$rg_network <- renderForceNetwork({
    req(input$trait1, input$top_trait2, input$ldsc_layer_depth)
