      "    const svgElement = document.getElementById('", svg_id, "');",
      "    if (!svgElement) { console.error('SVG #", svg_id, " not found.'); return; }",
      "    const textElements = svgElement.querySelectorAll('text[id^=\"label-\"]');",
      
      "    textElements.forEach(function(textEl) {",
      "      textEl.addEventListener('click', function() {",
      "        /* 1. 先取消旧的选中 */",
      "        textElements.forEach(el => el.classList.remove('selected'));",
      
      "        /* 2. 给当前点击元素加 selected 类 */",
      "        this.classList.add('selected');",
      
      "        /* 3. 通知 Shiny 当前组织名称 */",
      "        const tissueName = this.textContent.trim();",
