  output$tissue_svg_ui <- renderUI({
    generate_interactive_svg()
  })
  
  # Observer to react to the tissue name sent from SVG
  selected_tissue_reactive <- eventReactive({
    input$clicked_tissue_name_from_svg %||% input_default_smr$tissue
  }, {
    current_tissue <- input$clicked_tissue_name_from_svg %||% input_default_smr$tissue
    filterd_qtl_data <- db_smr %>% 
      dplyr::filter(Tissue == current_tissue) %>% 
      dplyr::select(Tissue, Expo_source, Trait, Gene, ProbeID, Chromsome, 
                    REF=A1, ALT=A2, b_GWAS, p_GWAS, b_eQTL, p_eQTL,
                    b_SMR, p_SMR, p_HEIDI, nsnp_HEIDI) %>% 
                    dplyr::collect()
    return(filterd_qtl_data)
  })
  

  smr_selected_tissue_count <- reactive({
    selected_tissue_reactive() %>%
      dplyr::select(Trait, p_SMR, Gene) %>%
      dplyr::group_by(Trait) %>%
      dplyr::summarise(
        `Genes(N)` = n(),
        `p_SMR(Min)` = min(p_SMR, na.rm = TRUE),
        .groups = "drop"
      ) %>%
      dplyr::arrange(`p_SMR(Min)`)
  })
  
  go_results_reactive <- reactive({ 
    req(smr_selected_trait())
    
    tryCatch({
      # Get current tissue name
      current_tissue <- input$clicked_tissue_name_from_svg %||% input_default_smr$tissue
      current_trait <- smr_selected_trait()
      
      # Load enrichment data
      enrich_data <- tbl(con, "smr_enrich") %>% 
      dplyr::select(Tissue,Trait,ID,Description,GeneRatio,BgRatio,pvalue,p.adjust,qvalue,ONTOLOGY,geneID,Count)
     
      # Remove duplicates and get top results
      filtered_results <- enrich_data %>%
        dplyr::filter(
          Tissue == current_tissue,
          Trait == current_trait
        ) %>%
        dplyr::collect()
      
      print(paste("Found", nrow(filtered_results), "enrichment results"))
      
      if (nrow(filtered_results) == 0) {
        return(data.frame())
      }
      
      # Convert to format similar to clusterProfiler output
      filtered_results <- filtered_results %>%
        dplyr::mutate(
          text_x = 0.5,
          text_label = paste("P:", signif(pvalue, 2)),
          # Ensure Count column is numeric
          Count = as.numeric(Count)
        ) %>%
        dplyr::group_by(ONTOLOGY) %>%
        dplyr::slice_min(pvalue, n = 5) %>%
        dplyr::ungroup()
      
      return(filtered_results)
      
    }, error = function(e) {
      print(paste("Error in go_results_reactive:", e$message))
      return(data.frame())
    })
  })
  
