  output$smr_trait_gene_go <- renderPlotly({
    if (is.null(input$smr_gene_count_rows_selected)) {
      # User hasn't selected any trait yet, return placeholder
      return(
        plot_ly() %>%
          layout(
            xaxis = list(showticklabels = FALSE, zeroline = FALSE),
            yaxis = list(showticklabels = FALSE, zeroline = FALSE),
            annotations = list(
              list(
                x = 0.5,
                y = 0.5,
                text = "<b>Please select a trait</b>",
                showarrow = FALSE,
                font = list(size = 20, color = 'gray'),
                xref = "paper",
                yref = "paper"
              )
            )
          )
      )
    }
    
    req(smr_selected_trait())
    
    tryCatch({
      # Get gene list for the selected trait
      genes <- selected_tissue_reactive() %>%
        dplyr::filter(Trait == smr_selected_trait()) %>%
        dplyr::pull(Gene) %>%
        unique()
      
      if (length(genes) == 0) {
        return(
          plot_ly() %>%
            layout(
              xaxis = list(showticklabels = FALSE, zeroline = FALSE),
              yaxis = list(showticklabels = FALSE, zeroline = FALSE),
              annotations = list(
                list(
                  x = 0.5,
                  y = 0.5,
                  text = "<b>No genes found for selected trait</b>",
                  showarrow = FALSE,
                  font = list(size = 20, color = 'gray'),
                  xref = "paper",
                  yref = "paper"
                )
              )
            )
        )
      }
      top_terms <- go_results_reactive()
      if (is.null(top_terms) || nrow(top_terms) == 0) {
        return(
          plot_ly() %>%
            layout(
              xaxis = list(showticklabels = FALSE, zeroline = FALSE),
              yaxis = list(showticklabels = FALSE, zeroline = FALSE),
              annotations = list(
                list(
                  x = 0.5,
                  y = 0.5,
                  text = "<b>No GO enrichment results found</b>",
                  showarrow = FALSE,
                  font = list(size = 20, color = 'gray'),
                  xref = "paper",
                  yref = "paper"
                )
              )
            )
        )
      }
      
      p <- top_terms %>%
        mutate(Description = factor(Description, levels = rev(Description))) %>%
        plot_ly(
          x = ~Count,
          y = ~Description,
          type = 'bar',
          orientation = 'h',
          color = ~ONTOLOGY,
          colors = "Set2",
          hoverinfo = 'text'
        ) %>%
        add_text(
          x = ~text_x,
          y = ~Description,
          text = ~text_label,
          showlegend = FALSE,
          textfont = list(color = "black", size = 12),
          textposition = "right"
        ) %>% 
        layout(
          barmode = "stack",
          yaxis = list(title = ""),
          xaxis = list(title = "Gene Count")
        )
      
      p
    }, error = function(e) {
      print(paste("Error in GO enrichment:", e$message))
      plot_ly() %>%
        layout(
          xaxis = list(showticklabels = FALSE, zeroline = FALSE),
          yaxis = list(showticklabels = FALSE, zeroline = FALSE),
          annotations = list(
            list(
              x = 0.5,
              y = 0.5,
              text = paste("<b>Error in GO enrichment:</b><br>", e$message),
              showarrow = FALSE,
              font = list(size = 16, color = 'red'),
              xref = "paper",
              yref = "paper"
            )
          )
        )
    })
  })

  # MR Network data for AI analysis
  mr_network_data <- reactive({
    network_result = updateNetwork()
    if (!is.null(network_result) && nrow(network_result$graph) > 0) {
      out = network_result$graph
      out = out %>% dplyr::select(exposure_name, outcome_name, exposure_umls, outcome_umls)
      return(out)
    } else {
      return(data.frame())
    }
  })

  mr_extra_instructions <- reactive({
    req(mr_network_data())
    
    prompt <- paste(
      "You are a helpful bioinformatics assistant specializing in Mendelian Randomization (MR) analysis. Your task is to analyze and summarize a causal network of traits based on MR evidence.",
      "Here is the MR causal network data showing relationships between exposures and outcomes:",
      "The columns in the data frame are as follows:",
      "- **exposure_name**: The exposure trait (potential cause) with database prefix (e.g., UKB:, FIN:)",
      "- **outcome_name**: The outcome trait (potential effect) with database prefix",
      "- **exposure_umls**: UMLS (Unified Medical Language System) identifier for the exposure trait",
      "- **outcome_umls**: UMLS identifier for the outcome trait",
      "## Your Task",
      "Based on the causal network data above, please provide a comprehensive analysis. Structure your response as follows:",
      "1. **Network Overview:** Provide a high-level summary of the causal network, including the number of unique traits and relationships.",
      "2. **Key Exposure Traits:** Identify and discuss the most important exposure traits (those that appear most frequently as exposures).",
      "3. **Key Outcome Traits:** Identify and discuss the most important outcome traits (those that appear most frequently as outcomes).",
      "4. **Disease Categories:** Group the traits by medical/biological categories (e.g., cardiovascular, metabolic, neurological, etc.) and describe the patterns.",
      "5. **Biological Insights:** Discuss the potential biological mechanisms and pathways suggested by these causal relationships.",
      "6. **Clinical Implications:** Explain what these causal relationships might mean for disease prevention, treatment, or understanding of disease etiology.",
      sep = "\n"
    )
    return(prompt)
  })

  ldsc_extra_instructions <- reactive({
    req(filtered_data())
    
    prompt <- paste(
      "You are a helpful bioinformatics assistant specializing in LD Score Regression (LDSC) analysis. Your task is to analyze and explain genetic correlation results between traits.",
      "Here are the LDSC results showing genetic correlations and heritability estimates:",
      "The columns in the data frame are as follows:",
      "- **Trait1**: The first trait in the correlation analysis with database prefix (e.g., UKB:, FIN:)",
      "- **Trait2**: The second trait in the correlation analysis with database prefix",
      "- **H2 Trait1 (95% CI)**: Heritability estimate for Trait1 with standard error (h² ± SE)",
      "- **Trait1 (P)**: P-value for the heritability estimate of Trait1",
      "- **H2 Trait2 (95% CI)**: Heritability estimate for Trait2 with standard error (h² ± SE)",
      "- **Trait2 (P)**: P-value for the heritability estimate of Trait2",
      "- **rg (95% CI)**: Genetic correlation coefficient between the two traits with standard error (rg ± SE)",
      "- **rg (P)**: P-value for the genetic correlation estimate",
      "## Your Task",
      "Based on the LDSC data above, please provide a comprehensive analysis. Structure your response as follows:",
      "1. **Genetic Correlation Summary:** Explain the genetic correlation coefficient (rg) and its statistical significance.",
      "2. **Heritability Analysis:** Discuss the heritability estimates for both traits and what they indicate about genetic influence.",
      "3. **Biological Interpretation:** Explain what the genetic correlation suggests about shared genetic architecture between the traits.",
      "4. **Statistical Considerations:** Comment on the statistical significance and reliability of the results.",
      "5. **Clinical Implications:** Discuss potential implications for understanding disease relationships, comorbidity, or shared biological pathways.",
      "6. **Limitations:** Mention any important limitations or considerations when interpreting these results.",
      sep = "\n"
    )
    return(prompt)
  })

  go_extra_instructions <- reactive({
    req(go_results_reactive())
    
    prompt <- paste(
      "You are a helpful bioinformatics assistant. Your task is to explain Gene Ontology (GO) enrichment analysis results to a researcher in a clear and concise way.",
      "Here are the top enriched GO terms for genes associated with the trait in the specified tissue:",
      "The columns in the data frame are as follows:",
      "- **ID**: Unique identifier for the GO term.",
      "- **Description**: Description of the GO term.",
      "- **GeneRatio**: Ratio of selected genes involved in this GO term.",
      "- **BgRatio**: Ratio of background genes involved in this GO term.",
      "- **pvalue**: Raw p-value for GO enrichment.",
      "- **p.adjust**: Adjusted p-value (FDR corrected).",
      "- **qvalue**: q-value for enrichment.",
      "- **ONTOLOGY**: Ontology category (BP = Biological Process, CC = Cellular Component, MF = Molecular Function).",
      "- **geneID**: List of gene symbols involved in this GO term.",
      "- **Count**: Number of selected genes associated with this GO term.",
      "- **Tissue**: The tissue or cell type in which gene expression data (eQTL) were measured, used to link genetic variants to gene expression (e.g., blood, brain).",
      "- **Trait**: The phenotype or disease of interest analyzed in the GWAS, such as height, schizophrenia, or diabetes.",
      "## Your Task",
      "Based on the data above, please provide a comprehensive explanation. Structure your response as follows:",
      "1.  **High-Level Summary:** Start with a brief, one-paragraph summary of the key findings.",
      "2.  **Detailed Breakdown:** Briefly explain the findings for each GO category (BP, CC, MF).",
      "3.  **Conclusion:** Conclude with the potential biological implications of these findings for the trait in this tissue.",
      sep = "\n"
    )
    return(prompt)
  })
  
  # MR AI functionality
  observeEvent(input$mr_AI_clicked, {
